import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'; // 필요한 라우터 불러오기
import App from './App'; // 애플리케이션의 진입점 불러오기
import GlobalStyles from './styles/GlobalStyles'; // 글로벌 스타일 불러오기

// createRoot를 사용하여 애플리케이션 렌더링
ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <BrowserRouter>
      <GlobalStyles />
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
